import React from 'react';
import Card from './Card';

let cardList = ({robots}) => {
	let cardArray = robots.map((user, i) => {
		return <Card 
		  key={i}
		  id={robots[i].id} 
		  name={robots[i].name} 
		  email={robots[i].email}/>
	})
		return (
		  <div>
			{cardArray}
		  </div>
	);
}

export default cardList;
